package org.tnsindia.operator;

public class Unary_Operator {

	@SuppressWarnings("unused")
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		

		int a=5, b=2;
		int x = a++;//5
		int y = ++b;//3
		int z = a+x;// 6 + 5
		System.out.println(z);

	}

}
